import React from "react";
import { Card, CardBody, CardTitle, CardText } from "reactstrap";  // Usando reactstrap para o layout

const StudentDetails = ({ student }) => {
  return (
    <div>
      <h3>Detalhes do Aluno</h3>
      <Card>
        <CardBody>
          <CardTitle tag="h5">{student.name}</CardTitle>
          <CardText><strong>Matrícula:</strong> {student.registration}</CardText>
          <CardText><strong>Nota Média:</strong> {student.average}</CardText>
        </CardBody>
      </Card>
    </div>
  );
};

export default StudentDetails;
